// src/components/Tile.js
import React from 'react';
import styled from 'styled-components';

const TileContainer = styled.div`
  width: 100%;
  height: 100%;
  background-color: #8a2be2;
  clip-path: polygon(50% 0%, 100% 25%, 100% 75%, 50% 100%, 0% 75%, 0% 25%);
  display: grid;
  grid-template-areas:
    "top top"
    "left right"
    "bottom bottom";
  color: white;
  font-weight: bold;
  font-size: 14px;
  cursor: pointer;
`;

const NumberTop = styled.div`
  grid-area: top;
  justify-self: center;
  align-self: start;
`;

const NumberLeft = styled.div`
  grid-area: left;
  justify-self: start;
  align-self: center;
`;

const NumberRight = styled.div`
  grid-area: right;
  justify-self: end;
  align-self: center;
`;

function Tile({ values, onClick }) {
  return (
    <TileContainer onClick={onClick}>
      <NumberTop>{values[0]}</NumberTop>
      <NumberLeft>{values[1]}</NumberLeft>
      <NumberRight>{values[2]}</NumberRight>
    </TileContainer>
  );
}

export default Tile;
